        set(gca, 'CLim', max(abs(get(gca, 'CLim'))) * [-1 1]);
        
        
        
        %rephasing or nonrephasing
        if strcmp(xphasing, 'rephasing')
            wmap = fliplr(wmap);
        elseif strcmp(xphasing,'nonrephasing')
        end
        
        
        
        %plot frequency domain maps
        figure('Position',[100 500 1600 450])
        %absolute-valued
        subplot(1,3,1)
        imagesc(E_tau,E_t,squeeze(abs(wmap(:,:))));
        titlename1 = sprintf('Absolute valued (T= %d fs)', T_value);
        title(titlename1);
        hold on
        disp(size(wmap(:,T_index,:)));
        contour(E_tau_nzp,E_t_nzp,squeeze(abs(wmap(:,:))),contnum,'LineColor','black');
        axis xy;
        set(gca,'YDir','normal');
        axis square;
        xlabel('$E_{\tau}$ \sf [eV]','Interpreter','latex');
        ylabel('$E_{t}$ \sf [eV]','Interpreter','latex');
        set(gca,'FontSize',fsize);
        colormap(clmap);
        colorbar;
        set(gca, 'CLim', max(abs(get(gca, 'CLim'))) * [-1 1]);
        
     
        %real part
        subplot(1,3,2)
        imagesc(E_tau,E_t,squeeze(real(wmap(:,:))));
        titlename2 = sprintf('Real part (T= %d fs)', T_value);
        title(titlename2);
        hold on
        contour(E_tau_nzp,E_t_nzp,squeeze(real(wmap(:,:))),contnum,'LineColor','black');
        axis xy;
        set(gca,'YDir','normal');
        axis square;
        xlabel('$E_{\tau}$ \sf [eV]','Interpreter','latex');
        ylabel('$E_{t}$ \sf [eV]','Interpreter','latex');
        set(gca,'FontSize',fsize);
        colormap(clmap);
        colorbar;
        set(gca, 'CLim', max(abs(get(gca, 'CLim'))) * [-1 1]);
        
        
        %imaginary part
        subplot(1,3,3)
        imagesc(E_tau,E_t,squeeze(imag(wmap(:,:))));
        titlename3 = sprintf('Imaginary part (T= %d fs)', T_value);
        title(titlename3);
        hold on
        contour(E_tau_nzp,E_t_nzp,squeeze(imag(wmap(:,:))),contnum,'LineColor','black');
        axis xy;
        set(gca,'YDir','normal');
        axis square;
        xlabel('$E_{\tau}$ \sf [eV]','Interpreter','latex');
        ylabel('$E_{t}$ \sf [eV]','Interpreter','latex');
        set(gca,'FontSize',fsize);
        colormap(clmap);
        colorbar;
        set(gca, 'CLim', max(abs(get(gca, 'CLim'))) * [-1 1]);        
end
